import React, {Component} from 'react';
import {Image, StyleSheet, Text, View, TouchableOpacity} from 'react-native';
import ImagePicker from 'react-native-image-picker';

export default class ChangePhoto extends Component {

  state = {
    urlImage: 'data:image/jpeg;base64,'
  }

  photos = () => {

    ImagePicker.launchImageLibrary({
      mediaType: 'photo',
      maxWidth: 700,
      maxHeight:700,
      quality: 0.6
    }, (response) => {
      console.log(response)
      const data = `data:${response.type};base64,${response.data}`;
      this.props.checkImg(data)
      this.setState({
        urlImage: data
      })
    });

  }

  render() {
    return (
      <View>
        <TouchableOpacity style={styles.button} onPress={this.photos}>
          <Text>photo</Text>
        </TouchableOpacity>
        <Image style={{width: 200, height: 200}} source={{uri: this.state.urlImage}}/>

      </View>
    );
  }
}

const styles = StyleSheet.create({
  button: {
    width: 200,
    height: 100,
    borderColor: 'red',
    borderWidth: 2,
    justifyContent: 'center',
    alignItems: 'center',
  }
});
